        public interface IClKernelCompiler
        {
            IShaderFilterSettings<IKernel> Compile(string sourceFileName, string entryPoint, string options = null);
        }
        
        public class NeoCnn : RenderChain, IClKernelCompiler
        {
            public NeoCnn()
            {
            }

            protected override string ShaderPath
            {
                get { return "NeoCNN.AI"; }
            }

            private List<IDictionary<string, object>> weights;

            protected override ITextureFilter CreateFilter(ITextureFilter input)
            {
                if (!Renderer.IsOpenClAvail || Renderer.RenderQuality.PerformanceMode())
                {
                    Renderer.FallbackOccurred = true; // Warn user via player stats OSD
                    return input; // OpenCL is not available, or UNORM8 textures used (not supported); fallback
                }

                var sourceSize = input.Size();
                if ((Renderer.TargetSize <= sourceSize).Any)
                    return input;

                var yuv = input.ConvertToYuv();

                weights = JsonConvert.DeserializeObject<List<IDictionary<string, object>>>(Weights.Neo4_2x);
                var filters = CreateFilters(weights, sourceSize).ToArray();

                throw new NotImplementedException();
            }

            private IEnumerable<ILayer> CreateFilters(List<IDictionary<string, object>> model, TextureSize size)
            {
                foreach (var layer in model)
                {
                    var layerType = (string) layer["t"];
                    if (layerType == "Conv2D")
                    {
                        yield return new ConvLayer();
                    }
                }
            }

            public interface ILayer
            {
                
            }

            public class ConvLayer : ILayer
            {
                private readonly IDictionary<string, object> m_Layer;
                private readonly int m_Outputs;
                private readonly int[] m_Weights;
                private readonly int[] m_KDims;
                private readonly int[] m_Dims;
                private readonly int[] m_ImageShape;
                private readonly int[] m_ResultDims;
                
                private readonly IDisposable m_ClWeights;
                private readonly IDisposable m_ClBias;
                private readonly int[] m_WorkgroupSize;
                private readonly int m_KVersion;
                private readonly ClKernelFilter m_ClKernelFilter;

                public ConvLayer(IClKernelCompiler compiler, IDictionary<string, object> layer, int[] dims, int[] imageShape)
                {
                    m_Layer = layer;
                    m_Outputs = (int) layer["o"];
                    var w = (JArray) layer["w"];
                    m_KDims = GetDimensions(w).ToArray();
                    m_Dims = dims;
                    m_ImageShape = imageShape;
                    m_ResultDims = new[] { m_Outputs, dims[1], dims[2] };
                    
                    m_ClWeights = Renderer.CreateClBuffer(GetWeights(w));
                    var b = (JArray) layer["b"];
                    m_ClBias = Renderer.CreateClBuffer(GetBias(b));

                    m_WorkgroupSize = GetWorkgroupSize(m_KDims);
                    m_KVersion = GetKernelVersion(m_KDims);
                    m_ClKernelFilter = GetClKernelFilter(compiler, m_KDims, m_WorkgroupSize, m_KVersion);
                }

                private ClKernelFilter GetClKernelFilter(IClKernelCompiler clKernelCompiler, int[] kDims, int[] workgroupSize, int version)
                {
                    var kernel = clKernelCompiler
                        .Compile(version == 1 ? "cl_conv2d.cl" : "cl_conv2d_2.cl", "run", GetClOptions(kDims, workgroupSize))
                        .Configure(transform: s => new TextureSize(m_ResultDims[1], m_ResultDims[2] * m_ResultDims[0])); // width, height * output_plane_count (stack vertically)
                }

                private string GetClOptions(int[] kDims, int[] workgroupSize)
                {
                    return string.Format(
                        "-DOUTPUT_DEPTH={0} -DKERNEL_DEPTH={1} -DFILTER_SIZE={2} -DWORKGROUP_SIZE_Y={3} -DWORKGROUP_SIZE_X={4}",
                        kDims[0], kDims[1], kDims[2], workgroupSize[0], workgroupSize[1]);
                }

                private static int[] GetWorkgroupSize(int[] kDims)
                {
                    return kDims[0] >= 10 
                        ? new[] {2, 4} 
                        : new[] {2, 8};
                }

                private static int GetKernelVersion(int[] kDims)
                {
                    return kDims[1] < kDims[0] || (kDims[1] == kDims[0] && kDims[1] <= 5) ? 1 : 2;
                }

                public override string ToString()
                {
                    return string.Format("Conv2D(v{0}, {1})", m_KVersion, FormatArray(m_KDims));
                }

                private class Filter : ClKernelFilter
                {
                    public Filter(IShaderFilterSettings<IKernel> settings, IDisposable buffer, int neuronCount, TextureSize textureSize, int[] localWorkSizes, ITextureFilter<IBaseTexture> inputFilter)
                        : base(settings, GlobalWorkSizesHelper.Get(textureSize.Height, textureSize.Width, localWorkSizes), localWorkSizes, inputFilter)
                    {
                    }
                }
            }

            private static int[] GetBias(JArray array)
            {
                return GetValues(array).ToArray();
            }

            private static int[] GetWeights(JArray array)
            {
                return FlattenArray(array).ToArray();
            }
            
            private static IEnumerable<int> GetValues(JArray array)
            {
                return array.Select(item => item.Value<int>());
            }

            private static IEnumerable<int> FlattenArray(JArray array)
            {
                return array.First() is JArray 
                    ? array.Cast<JArray>().SelectMany(FlattenArray) 
                    : GetValues(array);
            }

            private static IEnumerable<int> GetDimensions(JArray root)
            {
                for (var i = root; i != null; i = i[0] as JArray)
                    yield return i.Count;
            }
            
            private static string FormatArray(IEnumerable<int> array)
            {
                return string.Format("[{0}]", string.Join(" ", array));
            }

            public class ConvFilter : ClKernelFilter
            {
                public ConvFilter(IShaderFilterSettings<IKernel> settings, IDisposable buffer, int neuronCount,
                    TextureSize textureSize, int[] localWorkSizes, ITextureFilter<IBaseTexture> inputFilter)
                    : base(settings, GlobalWorkSizesHelper.Get(textureSize.Height, textureSize.Width, localWorkSizes),
                        localWorkSizes, inputFilter)
                {
                    
                }
            }

            public static class GlobalWorkSizesHelper
            {
                public static int[] Get(int width, int height, int[] localWorkSizes)
                {
                    var baseWidth = (float) localWorkSizes[0];
                    var baseHeight = (float) localWorkSizes[1];

                    var widthGroupCount = Math.Ceiling(width/(baseWidth*baseWidth));
                    var heightGroupCount = Math.Ceiling(height/baseHeight);
                    return new[] {(int) (baseWidth*widthGroupCount), (int) (baseHeight*heightGroupCount)};
                }
            }

            public IShaderFilterSettings<IKernel> Compile(string sourceFileName, string entryPoint, string options = null)
            {
                return CompileClKernel(sourceFileName, entryPoint, options);
            }
        }

